import React from "react";

function Left({
  imageURL,
  productName,
  productDescription,
  tryDemo,
  learnMore,
  playStore,
  appStore,
}) {
  return (
    <div className="container">
      <div className="col-6 p-3">
        <img src={imageURL}></img>
      </div>
      <div className="col-6">
        <h1>{productName}</h1>
        <p>{productDescription}</p>
        <a href="#">{tryDemo}</a>
        <a href="#">{learnMore}</a>
        <a href="#">{playStore}</a>
        <a href="#">{appStore}</a>
      </div>
    </div>
  );
}

export default Left;
